@Injectable()
export class CarsService {
  cars = [
    {
      name: 'Ford',
      id: 1,
      year: 2017,
      color: 'red'
    },
    {
      name: 'Audi',
      id: 2,
      year: 2017,
      color: 'red'
    },
    {
      name: 'BMW',
      id: 3,
      year: 2017,
      color: 'red'
    },
    {
      name: 'Mercedes',
      id: 4,
      year: 2017,
      color: 'red'
    }
  ]
}
